        <div className="container">
            <div className="row">
                <div className="col-12 col-md-4 offset-md-4">
                    <div className="card">
                        <div className="card-content">
                        test
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Welcome;
